import React, {useState} from "react";
import {
    Container,
    Row,
    Column
} from "../index";

//5454cb1b9be0477fb63a1b9fc15db6eb - API key

const News = (props) => {

    const [news, newsUpdate] = useState([]);


    let url = 'https://newsapi.org/v2/top-headlines?' +
        'country=us&' +
        'apiKey=5454cb1b9be0477fb63a1b9fc15db6eb';
    fetch(url)
        .then(response => {
           return response.json();
        })
        .then((data) => {
            newsUpdate(data)
        },[]);

    return (
        <Container>
            <Row>
                <Column>
                    {news.map((items, i) => (
                        <div key={i}>
                            {console.log(items)}
                        </div>
                    ))}
                </Column>
            </Row>
        </Container>
    )
};

export default News;
